import React from 'react'

export default function ResetPassword() {

    const onSubmit = (data)=>{
        console.log("submitted data , ", data);
        navigate('/');
    };

  return (
    <>
   <form onSubmit={handleSubmit(onSubmit)} style={{textAlign:'center', border:'solid', width:300, minHeight:300}}>
      
      <h2>Reset Password</h2>
      
      <label style={{width:80, float:'left'}}>New Password  </label>
      <input type='password' {...register("newPassword", {required:true})}></input>
      {/* {error.name && <h6 style={{color:'red'}}>{error.name}</h6>} */}
      <br/><br/>

      <label style={{width:80, float:'left'}}>Confirm Password  </label>
      <input type='confirmPassword' {...register("confirmPassword", {required:true})}></input>
      {/* {error.name && <h6 style={{color:'red'}}>{error.name}</h6>} */}
      <br/><br/>
      <br/><br/>
      <button type='submit'>Reset</button>

      <br/><br/>
  </form>
    </>
  )
}
